"use strict";(()=>{var t="scriptsLoaded";window.addEventListener(t,()=>{document.querySelectorAll('[data-el="team-card-item"]').forEach(e=>{let o=e.querySelector('[data-el="team-card-popover-trigger"]'),r=e.querySelector("dialog");if(!o||!r){console.debug("No trigger or popover found",'Looking for `[data-el="team-card-popover-trigger"]` and <dialog> in card',{cardEl:e});return}o.addEventListener("click",a=>{a.preventDefault(),r.showModal()})})});})();
